import React from "react";

import Homepage_Btn from './Homepage_Btn.js'

export const My_Reviews = (props) => {

    const Fetch_Posted_Reviews = async (input) =>{

        console.log(input)
        const Review_Posted = await fetch('/read_reviews',{
            method: 'GET',
            headers:{
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(input)
        })

        return await Review_Posted.json();

    }

    const Dispense_Review_Data = (props)=>{

        let USERDATA = undefined;

        if(props.userdata.id){USERDATA = props.userdata.id.userinfo.id}
        else{return;}
        
        switch(USERDATA.status){
        case('unverified'):
        console.log('unverified user income')
        break;
        
        case('verified'):
        console.log('verified user income',USERDATA)
        return <React.Fragment>

        </React.Fragment>

        default:
        console.log(USERDATA);
    }}

    return <React.Fragment>

        <div
        className="Personalize_Data_Page_Container"
        >

            <Homepage_Btn/>

            <div
            className="Personalized_Data_Container_Aligner"
            >
                <span
                className="Personalized_Data_Page_TextTitle"
                >
                My Reviews
                </span>
                <br></br>

                <span
                className="Personalized_Data_Page_TextTitle"
                >
                This Page
                <br></br>
                is Preparing
                </span>
            
                <Dispense_Review_Data
                userdata={props}
                />

            </div>

        </div>

    </React.Fragment>

}

export default My_Reviews
